/*
Below script will delete cost center 75R201 data completely from CCN including audit

Request came from Adam Jenknis from SMIS on 27Sep2017

Created : 09/27/2017 jxc517 CCN Project Team....
Changed :
*/
SELECT * FROM AUDIT_LOG WHERE TRANSACTION_ID LIKE '%75R201%';

EXEC CCN_UI_INTERFACE_APP_PKG.DELETE_COST_CENTER('75R201');

SELECT * FROM AUDIT_LOG WHERE TRANSACTION_ID LIKE '%75R201%';

COMMIT;
